import { AppBar, Toolbar, Box, Stack, Typography, IconButton, Switch, Divider, Drawer,
	List,
	ListItem,
	ListItemText,
	InputAdornment,
	Checkbox } from "@mui/material";
import React from "react";
import useMediaQuery from "@mui/material/useMediaQuery";
import { useState, useEffect, useCallback } from "react";
import LeftSection from "./LeftSection";
import RightSection from "./RightSection";
import Hero from "./Hero";
import SignUp from "./SignUp";
import Footer from "../Footer";
import OpportunitiesImage from "../Landing/viewposts.png";
import RelationshipImage from "../Landing/discussionpost.png";
import Video from "../Landing/cardiacrehab.mp4"
import SummariesImage from "../Landing/message.png";
import Banner from "./Banner";
import Image from "../Landing/Auditboard.png"
import { styled } from "@mui/material/styles";
import ButtonBase from "@mui/material/ButtonBase";
import { Grid, Paper } from "@mui/material";
import TextField from '@mui/material/TextField';
import firestore from '../../Utilities/firebase';
import { doc, setDoc, collection, getDocs, writeBatch } from "firebase/firestore"; 
import Logo from "../../images/Logo.svg";

import Portrait from "./Michael_Kim.jpg";
import Yelp from "./Yelp.png";
import Battery from "./Battery.jpg";
import Chess from "./Chess.jpg";
import Proteins1 from "./Proteins1.png";
import Proteins2 from "./Proteins2.jpeg";
import Proteins3 from "./Proteins3.jpg";
import Proteins4 from "./Proteins4.png";
import Proteins5 from "./Proteins5.png";
import Science1 from "./Science1.jpg";
import SciOly from "./SciOly.png";
import Uber from "./Uber.png";
import Wine from "./Wine.jpg";

import Net from "./NET.png";
import Azure from "./Azure.png";
import Blazor from "./Blazor.png";
import C from "./C.png";
import CSharp from "./CSharp.png";
import CPlus from "./C++.png";
import CSS from "./CSS.png";
import FSharp from "./FSharp.png";
import Figma from "./Figma.png";
import Firebase from "./Firebase.png";
import Git from "./Git.png";
import HTML from "./HTML.png";
import HuggingFace from "./Hugging.png";
import Java from "./Java.png";
import JavaScript from "./Javascript.png";
import Keras from "./Keras.png";
import Matplotlib from "./Matplotlib.png";
import MySQL from "./MySQL.png";
import Node from "./Node.png";
import Npm from "./Npm.png";
import Numpy from "./Numpy.png";
import Pandas from "./Pandas.png";
import Postgre from "./Postgre.png";
import Python from "./Python.png";
import Pytorch from "./Pytorch.png";
import R from "./R.png";
import Racket from "./Racket.png";
import ReactImage from "./React.png";
import SAS from "./SAS.png";
import Scikit from "./Scikit.png";
import Seaborn from "./Seaborn.png";
import SQLite from "./SQLite.png";
import Statsmodels from "./Statsmodels.png";
import Tensorflow from "./Tensorflow.png";
import Wasm from "./WebAssembly.png";


import ExpandedCard from "./ExpandedCard";
import SearchIcon from "@mui/icons-material/Search";

import { navigateTo } from "../../Utilities/navigate";
import { useNavigate, Link } from "react-router-dom";

import Avatar from "@mui/material/Avatar";
import Button from "@mui/material/Button";
import CssBaseline from "@mui/material/CssBaseline";
import LockOutlinedIcon from "@mui/icons-material/LockOutlined";
import Container from "@mui/material/Container";
import Modal from "@mui/material/Modal";
import CloseIcon from '@mui/icons-material/Close';
import emailjs from '@emailjs/browser';

const Img = styled("img")({
	margin: "auto",
	display: "block",
	maxWidth: "100%",
	maxHeight: "100%",
});

function TechnologiesSection({ calculatedWidthTechnologies, calculatedHeightTechnologies, smallerCalculatedWidthTechnologies, imgSrc, imgAlt, first }) {
	var color = first ? "transparent" : "black";
	return (
		<section style={{ display: "flex", paddingLeft: "24px", paddingRight: "24px" }}>
			<Box sx={{
				display: "flex",
				flexDirection: "row",
				alignItems: "center",
				justifyContent: "start",
				width: calculatedWidthTechnologies,
				height: calculatedHeightTechnologies
			}}>
				<div
					style={{
						borderLeft: "1.5px solid black",
						height: smallerCalculatedWidthTechnologies,
						paddingTop: "16px",
						paddingBottom: "16px",
						paddingRight: "16px",
					}}
				/>
				<Box sx={{
					display: "flex",
					flexDirection: "column",
					justifyContent: "center",
					alignItems: "center",
					width: calculatedHeightTechnologies,
					height: calculatedHeightTechnologies,
					paddingRight: "16px"
				}}>
					<div
						style={{
							borderTop: `1.5px solid transparent`,
							paddingBottom: "16px",
							width: smallerCalculatedWidthTechnologies
						}}
					/>
					<Box sx={{
						height: smallerCalculatedWidthTechnologies,
						width: smallerCalculatedWidthTechnologies
					}}>
						<Img
							alt={imgAlt[0]}
							src={imgSrc[0]}
							sx={{ height: smallerCalculatedWidthTechnologies, width: smallerCalculatedWidthTechnologies }}
						/>
					</Box>
					<div
						style={{
							borderBottom: `1.5px solid ${color}`,
							paddingTop: "16px",
							width: smallerCalculatedWidthTechnologies
						}}
					/>
				</Box>
				<div
					style={{
						borderLeft: "1.5px solid black",
						height: smallerCalculatedWidthTechnologies,
						paddingTop: "16px",
						paddingBottom: "16px",
						paddingRight: "16px",
					}}
				/>
				<Box sx={{
					display: "flex",
					flexDirection: "column",
					justifyContent: "center",
					alignItems: "center",
					width: calculatedHeightTechnologies,
					height: calculatedHeightTechnologies,
					paddingRight: "16px"
				}}>
					<div
						style={{
							borderTop: `1.5px solid transparent`,
							paddingBottom: "16px",
							width: smallerCalculatedWidthTechnologies
						}}
					/>
					<Box sx={{
						height: smallerCalculatedWidthTechnologies,
						width: smallerCalculatedWidthTechnologies
					}}>
						<Img
							alt={imgAlt[1]}
							src={imgSrc[1]}
							sx={{ height: smallerCalculatedWidthTechnologies, width: smallerCalculatedWidthTechnologies }}
						/>
					</Box>
					<div
						style={{
							borderBottom: `1.5px solid ${color}`,
							paddingTop: "16px",
							width: smallerCalculatedWidthTechnologies
						}}
					/>
